import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import TouristAgencyUI from './TouristAgencyUI';


const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <TouristAgencyUI />
  </React.StrictMode>
);
